import React, { useState, useContext, useEffect } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import StoreContext from '../components/Store/Context';
import logo from "../img/logo.png";
import './sidebar.css'
/*
import logo from "../img/logo.png";

import Encomendas from '../pages/Encomendas';
import RecursosHumanos from '../pages/RecursosHumanos';
import VendasRealizadas from '../pages/VendasRealizadas';
import PrateleiraseEstoque from '../pages/EstoqueePrateleiras'
import Relatorios from '../pages/Relatorios'
import Departamento from '../pages/Departamento'
import JornadadeTrabalho from '../pages/JornadadeTrabalho'
*/

function Sidebar ({userData, newMessage, token}) {
    const navigate = useNavigate();
	const { setToken } = useContext(StoreContext);

    return (
        <>
	<div className="sidenav">
        <img
              alt=""
              src={logo}
              width="150"
              height="150"
              className="img-logo"
              />{' '}

		<div className="options">
			<span className="options-title">OPÇÕES</span>
			<div className="options-rest">
				<a className="item-a">

					<span className="item" onClick={(event) => newMessage(event, 1)}>
					<svg width="50px" height="50px" viewBox="0 0 1024 1024" class="icon" version="1.1" xmlns="http://www.w3.org/2000/svg" fill="#000000" transform="matrix(1, 0, 0, 1, 0, 0)"><g id="SVGRepo_bgCarrier" stroke-width="0"></g><g id="SVGRepo_tracerCarrier" stroke-linecap="round" stroke-linejoin="round" stroke="#CCCCCC" stroke-width="6.144"></g><g id="SVGRepo_iconCarrier"><path d="M716 190.9v-67.8h-44v67.8H352v-67.8h-44v67.8H92v710h840v-710H716z m-580 44h172v69.2h44v-69.2h320v69.2h44v-69.2h172v151.3H136V234.9z m752 622H136V402.2h752v454.7z" fill="#39393A"></path><path d="M319 565.7m-33 0a33 33 0 1 0 66 0 33 33 0 1 0-66 0Z" fill="#E73B37"></path><path d="M510 565.7m-33 0a33 33 0 1 0 66 0 33 33 0 1 0-66 0Z" fill="#E73B37"></path><path d="M701.1 565.7m-33 0a33 33 0 1 0 66 0 33 33 0 1 0-66 0Z" fill="#E73B37"></path><path d="M319 693.4m-33 0a33 33 0 1 0 66 0 33 33 0 1 0-66 0Z" fill="#E73B37"></path><path d="M510 693.4m-33 0a33 33 0 1 0 66 0 33 33 0 1 0-66 0Z" fill="#E73B37"></path><path d="M701.1 693.4m-33 0a33 33 0 1 0 66 0 33 33 0 1 0-66 0Z" fill="#E73B37"></path></g></svg>
						Jornada de Trabalho
						</span>
				</a>
				<a className="item-a">
					
					<span className="item" onClick={(event) => newMessage(event, 2)}>Recursos Humanos</span>
				</a>{ token == 3 || token == 1 ?
					<a class="item-a">
				
					<span className="item" onClick={(event) => newMessage(event, 3)}>Vendas</span>
				</a>
				: ''}
				
				{token == 2 || token == 1 ? <a class="item-a">
					
					<span className="item" onClick={(event) => newMessage(event, 4)}>Encomendas</span>
				</a> : ''}

				
				{ token == 1 ? <a class="item-a">
					
					<span className="item"onClick={(event) => newMessage(event, 5)}>Relatórios</span>
				</a> : ''}
				{token == 1 ? <a class="item-a">
					
					<span className="item"onClick={(event) => newMessage(event, 6)}>Funcionários</span>
				</a>: ''}
	
				<a class="item-a">
			<span className="item"onClick={(event) => newMessage(event, 7)}>Usuário</span>
			</a>
			<a class="item-a">
			<span className="item" onClick={() => setToken(null)}>Encerrar</span>
			</a>
			</div>
			
		</div>
		
	</div>

  
      </>
      );
};



export default Sidebar
